import React from "react";

function PhoneItem() {
    return (
        <div className="post">
            <div className="post__content">
                <h3>Post</h3>
                <p>Post</p>
            </div>
            <div className="post__btns">
                <button>Удалить</button>
            </div>
        </div>
    );
}

export default PhoneItem;
